import React from "react";
import Contact from "./Contact";
import { Link } from "react-router-dom";

const MealSearch = ({category}) => {
    return(
        <Contact>
            <h1>Meal Search</h1>
            {
                category
            }
        </Contact>
    )
}
export default MealSearch
